// SPDX-License-Identifier: MIT
pragma solidity ^0.8.13;

import "@openzeppelin/contracts/token/ERC1155/extensions/ERC1155URIStorage.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC1155/extensions/ERC1155Burnable.sol";
import "@openzeppelin/contracts/utils/Strings.sol";

contract Final is ERC1155URIStorage, ERC1155Burnable, Ownable {
    enum ApprovalStatus {
        Pending,
        Approved,
        Declined
    }

    struct CarbonCredit {
        uint256 tokenId;
        address owner;
        ApprovalStatus status;
        uint256 pricePerCredit;
        bool isListed;
    }

    event CarbonCreditCreated(
        uint256 tokenId,
        address owner,
        ApprovalStatus status,
        uint256 pricePerCredit,
        bool isListed
    );

    event CarbonCreditListed(
        uint256 tokenId,
        address owner,
        ApprovalStatus status,
        uint256 pricePerCredit,
        bool isListed
    );

    uint256 private _tokenIds;
    uint256 private _listedTokens;
    mapping(uint256 => CarbonCredit) public carbonCredits;
    mapping(uint256 => uint256) public creditTokenSupply;

    constructor()
        ERC1155(
            "https://ipfs.io/ipfs/QmdsFvho7K1GtSCLbSaqhtVz6EASFKPkfhNA5NXLsZZ1ch/{id}.json"
        )
    {}

    // function uri(
    //     uint256 tokenId
    // ) public view override(ERC1155, ERC1155URIStorage) returns (string memory) {
    //     return ERC1155URIStorage.uri(tokenId);
    // }

    function uri(
        uint256 tokenId
    ) public pure override(ERC1155, ERC1155URIStorage) returns (string memory) {
        return
            string(
                abi.encodePacked(
                    "https://ipfs.io/ipfs/QmdsFvho7K1GtSCLbSaqhtVz6EASFKPkfhNA5NXLsZZ1ch/",
                    Strings.toString(tokenId),
                    ".json"
                )
            );
    }

    // Allows user to register a project
    function registerProject(uint256 tokenSupply) public {
        uint256 currentId = _tokenIds++;
        carbonCredits[currentId] = CarbonCredit(
            currentId,
            msg.sender,
            ApprovalStatus.Pending,
            0,
            false
        );
        creditTokenSupply[currentId] = tokenSupply;
    }

    function approveProject(uint256 tokenId) public onlyOwner {
        require(
            carbonCredits[tokenId].status == ApprovalStatus.Pending,
            "Project cannot be approved"
        );
        _listedTokens++;
        carbonCredits[tokenId].status = ApprovalStatus.Approved;
        _mint(
            carbonCredits[tokenId].owner,
            tokenId,
            creditTokenSupply[tokenId],
            ""
        );
        _setURI(tokenId, uri(tokenId));
        emit CarbonCreditCreated(
            tokenId,
            carbonCredits[tokenId].owner,
            ApprovalStatus.Approved,
            0,
            false
        );
    }

    function declineProject(uint256 tokenId) public onlyOwner {
        require(
            carbonCredits[tokenId].status == ApprovalStatus.Pending,
            "Project cannot be declined"
        );
        carbonCredits[tokenId].status = ApprovalStatus.Declined;
        _setURI(tokenId, uri(tokenId));
    }

    function listCreditsForSale(uint256 tokenId, uint256 price) public {
        require(
            msg.sender == carbonCredits[tokenId].owner,
            "Only the credits owner can list the credits for sale."
        );
        require(
            carbonCredits[tokenId].status == ApprovalStatus.Approved,
            "The credits must be approved before it can be listed for sale."
        );
        require(
            !carbonCredits[tokenId].isListed,
            "The credits is already listed for sale."
        );
        require(price > 0, "The price per credit must be greater than zero.");

        // Set the token as listed and update the price
        carbonCredits[tokenId].isListed = true;
        carbonCredits[tokenId].pricePerCredit = price;
        emit CarbonCreditListed(
            tokenId,
            carbonCredits[tokenId].owner,
            ApprovalStatus.Approved,
            price,
            true
        );
    }

    function getCreditItem(
        uint256 tokenId
    ) public view returns (CarbonCredit memory) {
        return carbonCredits[tokenId];
    }

    function getListedTokensCount() public view returns (uint256) {
        return _listedTokens;
    }
}
